import React, { useEffect, useState } from "react";
import axiosInstance from "../../baseurl";

function Docchat() {
  const [allcustomers, setallcustomers] = useState([]);
  useEffect(() => {
    axiosInstance
      .post(`/viewCustomersforDr/${localStorage.getItem("Doctorlogid")}`)
      .then((res) => {
        console.log(res, "View Customers for doc");
        if (res.data.data != undefined) {
          const x = []
          for (let i of res.data.data) {
            axiosInstance
              .post(`/viewCustomerById/${i}`)
              .then((res) => {
                console.log(res, "View individual customer");
                if (res.data.data != undefined) {
                  console.log(res.data.data.name);
                  x.push(res.data.data)
                } 
              })
              .catch((err) => {
                console.log(err);
              });
          }
          setallcustomers([...allcustomers, res.data.data]);
        }
      })
      .catch((err) => {
        console.log(err);
      });
  }, []);
  useEffect(() => {
    console.log(allcustomers);
  });
  return (
    <div className="container-top">
      Docchat
      <div className="container">
        <div className="row">
          <div className="col">
            <h1> Customers</h1>
            <hr />
            {allcustomers.length
              ? allcustomers.map((a) => {
                  return <p key={a._id}> {a.name}</p>;
                })
              : null}
          </div>
          <div className="col"></div>
        </div>
      </div>
    </div>
  );
}

export default Docchat;
